SELECT development.jcap_fom_file.id AS "jcapFomFile:ID(JcapFomFile)", 'JcapFomFile' AS ":LABEL", development.jcap_fom_file.deleted AS deleted, development.jcap_fom_file.filename AS filename, development.jcap_fom_file.file_type AS file_type, development.jcap_fom_file.headers AS headers 
FROM development.jcap_fom_file